function omitValue(data) {
  if(!data) return {};
  const ignore = ["iamuid"];

  const obj ={};
  const objEntries = Object.keys(data)

  for(key of objEntries){
    if(ignore.includes(key)) {
        continue;
    }

    obj[key] = key === "reportingto" ? omitValue(data[key]) : data[key];
  }

  return obj;
}

userFields.code:
function userFields(fields) {

    if (!fields) return;

    let arr = [];

    fields.filter(i => i.enabled && !i.system_defined).forEach(item => {
        let obj = {
            name: item.unique_name,
            label: item.label,
            required: item.mandatory
        };

        switch (item.type) {
            case "text_field":
                obj.type = 'text';
                break;

            case "drop_down":
                obj.type = 'select';
                obj.options = item.options.map(i => {
                    return {
                        label: i.name,
                        value: i.id
                    };
                });
                break;

            case "url":
                obj.type = 'url';
                break;

            case "date_picker":
                obj.type = 'date';
                break;

            case "number":
                obj.type = 'number';
                break;

            default:
                return;
        }

        arr.push(obj);
    });

    return {
        name: 'custom_field',
        label: 'Custom Fields',
        type: 'collection',
        spec: arr
    };

}

